import React from "react";

class Testing extends React .Component{
    constructor(props){
        super(props);
        this.state={
            name:"Naveen",
            city:"Tadipatri",
            age:25

        }
    }
    render(){
        return(
            <div>
                {this.state.name}<br/>
                {this.state.city}<br/>
                {this.state.age}<br/>
                <button>Change</button>
            </div>
        )
    }
}
export default Testing;
